Arrays represent a sequence of values. They can hold any number of values of a specific type. fn main() { let fruits: string[] = ["Banana", "Apple", "Pineapple"] for fruit in fruits { println(fruit) }
} $ sb run main.sb
Banana
Apple
Pineapple Arrays have a fixed capacity. In most cases, the capacity of an array can be infered. In the example above, the compiler knows that three elements are in the array, so it can be inferred. If the capacity can't be inferred by the compiler, it is necessary to mark it explicitely. This is the case for uninitialized arrays: let arr: int[3]
arr[0] = 1
arr[1] = 2
arr[2] = 3 for element in arr { println(element)
}

