Functions can also be defined to have parameters, which are special variables that are part of a function’s signature. When a function has parameters, you can provide it with concrete values for those parameters. Technically, the concrete values are called arguments, but in casual conversation, people tend to use the words parameter and argument interchangeably for either the variables in a function’s definition or the concrete values passed in when you call a function. The following rewritten version of another_function shows what parameters look like in Antimony: fn main() { another_function(5)
} fn another_function(x: int) { println(x)
