An if expression allows you to branch your code depending on conditions. You provide a condition and then state, "If this condition is met, run this block of code. If the condition is not met, do not run this block of code." Here is a basic example of an if expression: fn main() { let number = 3 if number < 5 { println("condition was true") } else { println("condition was false") }
} All if Statements start with the keyword if, followed by a condition. In this case, the condition checks if the number has a value less than 5. The block of code we want to execute if the condition is true is placed immediately after the condition inside curly braces. Optionally, we can also include an else expression, which we chose to do here, to give the program an alternative block of code to execute should the condition evaluate to false. If you don’t provide an else expression and the condition is false, the program will just skip the if block and move on to the next bit of code. Try running this code; You should see the following output: $ sb run main.sb
condition was true Let’s try changing the value of number to a value that makes the condition false to see what happens: let number = 7 Run the program again, and look at the output: $ sb run main.sb
condition was false Note : It's worth noting that the condition in this code must be a bool. At the current state of the project, this is not the case, but it is subject to change at any time. TODO : Discuss this behavior.

