To use a struct after we’ve defined it, we create an instance of that struct by specifying concrete values for each of the fields. We create an instance by stating the name of the struct and then add curly brackets containing key: value pairs, where the keys are the names of the fields and the values are the data we want to store in those fields. We don’t have to specify the fields in the same order in which we declared them in the struct. In other words, the struct definition is like a general template for the type, and instances fill in that template with particular data to create values of the type. Let's use our User struct from a previous example and create an user called alice. struct User { username: string email: string sign_in_count: int active: bool
} let alice = new User { email: "alice@example.com" username: "alice" sign_in_count: 1 active: true
} To get a specific value from a struct, we can use dot notation. If we wanted just alice's email address, we could use alice.email wherever we wanted to use this value. Fields of structs can also be reassigned using the dot notation: let alice = new User { email: "alice@example.com" username: "alice" sign_in_count: 1 active: true
} alice.sign_in_count = 2

