Antimony supports the concept of methods. A method can be described as a function on a struct. Let's take a look at a struct implementing a method. struct User { first_name: string last_name: string fn full_name(): string { return self.first_name + " " + self.last_name }
} Every instance of the User struct can now call full_name(). Note the usage of the word self. self is a special keyword referencing the struct instance the method was called on. Say we had the following instance of User, and called the full_name() method on it. let alice = new User { first_name: "Jon" last_name: "Doe"
} println(alice.full_name()) The full_name method described above will return the first name, a space and the last name of the user. If we run this code, we should see the expected output: $ sb run main.sb
Jon Doe Methods behave just like functions. They can return a value and take parameters. The only difference is the self keyword, which allows you to execute it on a specific instance of a struct.

