To use code defined in a separate module, we first need to import it. This is usually done at the top of the file, but it technically doesn't make a difference where in the document the import is defined. Once the module is imported, we can use the code inside it, as if it were in the current file. Let's say we have a module named math.sb in the same directory as out main.sb, and it defines the function add(x: int, y: int): int. To call it in our main.sb, we'd do the following: import "math" fn main() { println(add(1, 2))
} If we run main.sb, we should see the expected output. Antimony has imported the add function from the math module. $ sb run main.sb
